import{_ as e,c as n,o as a,d as r}from"./app.e77446fd.js";const m=JSON.parse('{"title":"202301","description":"","frontmatter":{},"headers":[{"level":2,"title":"0102","slug":"_0102","link":"#_0102","children":[]},{"level":2,"title":"0103","slug":"_0103","link":"#_0103","children":[]},{"level":2,"title":"0104","slug":"_0104","link":"#_0104","children":[]}],"relativePath":"work/202301.md"}'),t={name:"work/202301.md"},s=r(`<h1 id="_202301" tabindex="-1">202301 <a class="header-anchor" href="#_202301" aria-hidden="true">#</a></h1><h1 id="_0101" tabindex="-1">0101 <a class="header-anchor" href="#_0101" aria-hidden="true">#</a></h1><p>新年第一天就把腰给闪了，不是一个很好的征兆，希望新年还是要在身体安康的情况下，度过每一天</p><ul><li>jenkin 本地 ip 地址：<a href="http://111.230.199.157:8080/" target="_blank" rel="noreferrer">http://111.230.199.157:8080/</a></li></ul><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki material-palenight"><code><span class="line"><span style="color:#A6ACCD;"># 启动 Jenkins 服务</span></span>
<span class="line"><span style="color:#A6ACCD;">systemctl start jenkins</span></span>
<span class="line"><span style="color:#A6ACCD;"># 重启 Jenkins 服务</span></span>
<span class="line"><span style="color:#A6ACCD;">systemctl restart jenkins</span></span>
<span class="line"><span style="color:#A6ACCD;"># 停止 Jenkins 服务</span></span>
<span class="line"><span style="color:#A6ACCD;">systemctl stop jenkins</span></span>
<span class="line"><span style="color:#A6ACCD;"># 查看 Jenkins 服务状态</span></span>
<span class="line"><span style="color:#A6ACCD;">systemctl status jenkins</span></span>
<span class="line"></span></code></pre></div><h2 id="_0102" tabindex="-1">0102 <a class="header-anchor" href="#_0102" aria-hidden="true">#</a></h2><ul><li><a href="https://mp.weixin.qq.com/s/UqkG_Pirt2jdXg7stepmqw" target="_blank" rel="noreferrer">Jenkins 配置</a></li><li>如果你 clone 下来一个别人的仓库，在此基础上完成你的代码，推送到自己的仓库可能遇到如下问题： error: remote origin already exists.表示远程仓库已存在。 因此你要进行以下操作： 1、先输入 git remote rm origin 删除关联的 origin 的远程库 2、关联自己的仓库 git remote add origin <a href="https://gitee.com/xxxxxx.git" target="_blank" rel="noreferrer">https://gitee.com/xxxxxx.git</a> 3、最后 git push -u origin master，这样就推送到自己的仓库了。</li></ul><h2 id="_0103" tabindex="-1">0103 <a class="header-anchor" href="#_0103" aria-hidden="true">#</a></h2><p>新年第一天上班，有一股无形的压力笼罩心头。对去年工作年终奖没有期待就没有失望。期望越大，失望越大，本来平时也不是很努力的那一个，加上业务也没有多少增常，OKR 也不是特别好看，所以去年工作上也就这样了，算是一种躺平吧。 分享一篇关于<a href="https://mp.weixin.qq.com/s/wq4dM_cRuAfXSTnaP1uGNQ" target="_blank" rel="noreferrer">前端开发的价值文章</a></p><ul><li><p>今天搞自己的图床，申请了腾讯云的 COS 对象存储服务，又申请了自定义 CDN 加速域名服务，被其中的几个配置搞的晕头转向的，CNAME</p></li><li><p>域名解析 域名解析就是域名到 IP 地址的转换过程。IP 地址是网路上标识您站点的数字地址，为了简单好记，采用域名来代替 ip 地址标识站点地址。域名的解析工作由 <strong>DNS 服务器</strong>完成。</p></li><li><p>A 记录 A 记录是用来<strong>指定主机名（或域名）对应的 IP 地址记录</strong>。用户可以将该域名下的网站服务器指向到自己的 web server 上。同时也可以设置您域名的二级域名。</p></li><li><p>CNAME 记录 CNAME 记录，即：别名记录。这种记录允许您将多个名字映射到同一台计算机。 通常用于同时提供 WWW 和 MAIL 服务的计算机。例如，有一台计算机名为“<a href="http://host.mydomain.com" target="_blank" rel="noreferrer">host.mydomain.com</a>”（A 记录）。 它同时提供 WWW 和 MAIL 服务，为了便于用户访问服务。可以为该计算机设置两个别名（CNAME）：WWW 和 MAIL。</p></li></ul><h2 id="_0104" tabindex="-1">0104 <a class="header-anchor" href="#_0104" aria-hidden="true">#</a></h2><p>今天继续爆 COS 对象存储以及 CDN 域名加速这块争取搞清楚</p><ul><li>怎么看网站有没开启 CDN？ 用户在购买 CDN 服务之后，在使用过程中会比较关心是否有实际效果，首先大家要先确保是否已经开通成功，然后按照基本步骤添加<strong>加速域名、配置 CNAME</strong>,这些都成功搞定之后，接下来就可以测试 CDN 是否加速成功了. 要看一个网站是否开启 CDN，方法很简单，只要在不同的地区 ping 网址就可以，比如在山东济南 ping <a href="http://www.jb51.net" target="_blank" rel="noreferrer">www.jb51.net</a> 得到的 IP 地址是 111.161.66.167，但在江苏地区 ping www.jb51.net得到的IP确是61.147.92.111，像这样在不同地区ping同一个网址，得到不同的IP地址，那么这种情况就可以判断该网站开了CDN加速。</li></ul><p>如果网站没有开启 CDN，不同地区 Ping 网址是网站服务器的真实地址，如果开启了 CDN 加速，网站内容会缓存到各地区离你最近的服务器，所以访问 IP 会发生变化，根据这个原理，就很容易判断网站是否开启了 CDN 了。 推荐网站测试工具二：<a href="https://ping.chinaz.com/bythewayer.com" target="_blank" rel="noreferrer">站长工具 Ping</a></p><ul><li><p>cdn CNAME: <strong><a href="http://bythewayer.com.cdn.dnsv1.com.cn" target="_blank" rel="noreferrer">bythewayer.com.cdn.dnsv1.com.cn</a></strong> 如何查看当前域名的解析生效状态？<a href="https://cloud.tencent.com/document/product/228/3149" target="_blank" rel="noreferrer">如何验证 CNAME 是否生效</a> 如果您的系统为 Mac 系统或 Linux 系统，可以使用 dig 命令进行验证，以域名www.test.com为例，您可以在终端内运行命令：dig <a href="http://www.test.com" target="_blank" rel="noreferrer">www.test.com</a>，根据运行的解析结果内，可以查看该域名的 CNAME 信息，如果与腾讯云 CDN 提供的 CNAME 地址一致，即当前的 CDN 加速已生效</p></li><li><p>cos 默认域名：即 COS 源站域名，是创建存储桶时，由系统根据存储桶名称和地域自动生成的。CNAME: <a href="http://wmh-1307694505.cos.ap-nanjing.myqcloud.com" target="_blank" rel="noreferrer">wmh-1307694505.cos.ap-nanjing.myqcloud.com</a></p></li><li><p>自定义源站域名：用户可以将已备案的自定义域名，绑定至当前存储桶，通过自定义域名访问桶内对象。</p></li><li><p>问题：PICGo 设置腾讯云 COS 时设定自定义域名不生效？</p></li></ul>`,15),l=[s];function i(o,p,c,h,d,_){return a(),n("div",null,l)}const C=e(t,[["render",i]]);export{m as __pageData,C as default};
